import './index.css';
import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";


function App() {
  return (

    <div className='flex'>
      <nav className="w-20 h-screen flex flex-col justify-around items-center bg-indigo-950 text-white text-4xl">
        <FiFeather />
        <hr className='w-1/2' />
        <div id='functions' className='h-2/5 flex flex-col'>
          <BiHomeAlt2 />
          <BiUser />
          <BiLogOut />
        </div>
        <hr className='w-1/2' />
        <BiInfoCircle />
      </nav>
    </div>


  );
}

export default App;
